CREATE TABLE `bdc_datos_acad` (
  `codg_per` int(11) NOT NULL DEFAULT '0' COMMENT 'Cédula personal',
  `codg_niv_inst` int(11) NOT NULL DEFAULT '0' COMMENT 'Código del nivel de instrucción',
  `estudia_act` char(2) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Estudia Si ó No',
  `codg_car` int(11) DEFAULT '0' COMMENT 'Código de la carrera que estudia',
  `estudia_sem` int(11) DEFAULT '0' COMMENT 'Semestre que estudia',
  `fec_grado` date DEFAULT NULL COMMENT 'Fecha de la Graduación',
  `codg_mov` int(11) NOT NULL COMMENT 'Código de movimiento',
  PRIMARY KEY (`codg_mov`),
  KEY `codg_per` (`codg_per`),
  CONSTRAINT `bdc_datos_acad_ibfk_1` FOREIGN KEY (`codg_per`) REFERENCES `bdc_datos_per` (`codg_per`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `bdc_datos_acad_ibfk_2` FOREIGN KEY (`codg_mov`) REFERENCES `bdc_movimientos` (`codg_mov`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;
