  `codg_tip_trab` char(1) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Código del tipo de trabajador',
  `foto_per` mediumblob COMMENT 'Foto del personal',
  `tip_foto_per` varchar(20) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Tipo de archivo',
  `fec_ing_per` date NOT NULL DEFAULT '0000-00-00' COMMENT 'Fecha de ingreso al sistema educativo',
  `activo_per` char(1) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Estado activo o desactivo',
